import React, {useEffect, useState} from 'react';
import {apiGetLicense} from "../backendQuery";
import {CardDeck, Carousel, Container} from "react-bootstrap";
import License from "./License";
import hmm from "./asss.pdf"

const LicenseList = ({selectedLicense}) => {
    const [licenses, setLicenses] = useState([])

    // Carousel
    const [index, setIndex] = useState(0);
    const ass = [
        {
            "license_type":"MP# License",
            "license_price": "80"
        },
        {
            "license_type":"WAV License",
            "license_price": "120"
        },
        {
            "license_type":"WAV + Trackouts License",
            "license_price": "150"
        },
        {
            "license_type":"Exclusive License",
            "license_price": "150"
        }
        ]
    const handleSelect = (selectedIndex, e) => {
        setIndex(selectedIndex);
    }

    useEffect(() => {
        setLicenses(ass);

        const handleBeatsList = (response) => {
            // setLicenses(response.data);
            // setLicenses(ass);
        }
        // apiGetLicense(handleBeatsList)
    },[])

    return (
        <>
            <Container>
                <CardDeck>
                    {licenses.map((license)=> (
                        <License key={license.license_type} license={license} />
                    ))}
                        </CardDeck>
                <Carousel activeIndex={index} onSelect={handleSelect} controls={false} indicators={true} interval={7000}>
                    {licenses.map((license)=> (
                    <Carousel.Item>
                        <License key={license.license_type} license={license} />
                    </Carousel.Item>
                        ))}
                </Carousel>
            </Container>

        </>
    );

}

export default LicenseList;
